import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './index.css';
import './Button.css';
import Navbar from './Components/Navbar';
import HomePage from './Components/Homepages/Homepage';
// Import other components as needed
import Work from './Components/Work';

function App() {
  const [theme, setTheme] = useState('dark');
  const routes = createBrowserRouter([
    { path: '/', element: <Home /> },
    { path: '/decoder/about', element: <About /> },
    { path: '/decoder/skills', element: <Skills /> },
    { path: '/decoder/contact', element: <Contact /> },
    { path: '/decoder/work', element: <Work /> },
    { path: '/decoder/emailjs', element: <Emailjs /> },
    { path: '/decoder/repositories', element: <Repositories /> },
    { path: '/decoder/education', element: <Education /> },
    { path: '/decoder/projects', element: <Projects /> },
    { path: '*', element: <div>404 Not Found</div> },
  ]);
  
  return (
    <div className="App">
      <Router>
        <Navbar theme={theme} setTheme={setTheme} />
        <Routes>
          {/* <Route path="/" element={<HomePage theme={theme} />} />
          <Route path="/resume" element={<Work />} /> */}
          <HomePage/>
          {/* Add more routes here */}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
